import{_ as a,c as e,a8 as t,o as l}from"./chunks/framework.BDnHobkS.js";const _=JSON.parse('{"title":"Симуляція кількох рухомих засобів","description":"","frontmatter":{},"headers":[],"relativePath":"uk/simulation/multi-vehicle-simulation.md","filePath":"uk/simulation/multi-vehicle-simulation.md"}'),s={name:"uk/simulation/multi-vehicle-simulation.md"};function h(o,i,r,m,u,c){return l(),e("div",null,i[0]||(i[0]=[t('<h1 id="симуляція-кількох-рухомих-засобів" tabindex="-1">Симуляція кількох рухомих засобів <a class="header-anchor" href="#симуляція-кількох-рухомих-засобів" aria-label="Permalink to &quot;Симуляція кількох рухомих засобів&quot;">​</a></h1><p>PX4 підтримує симуляцію кількох рухомих засобів використовуючи наступні симулятори:</p><ul><li><a href="./../sim_gazebo_gz/multi_vehicle_simulation.html">Multi-Vehicle Sim with Gazebo</a> (both with and without ROS)</li><li><a href="./../sim_gazebo_classic/multi_vehicle_simulation.html">Multi-Vehicle Sim with Gazebo Classic</a> (both with and without ROS)</li><li><a href="./../sim_flightgear/multi_vehicle.html">Multi-Vehicle Sim with FlightGear</a></li><li><a href="./../sim_jmavsim/multi_vehicle.html">Multi-Vehicle Sim with JMAVSim</a></li></ul><p>Вибір симулятора залежить від рухомого засобу що моделюється, наскільки &quot;якісна&quot; потрібна симуляція (і для яких функцій), і скільки засобів потрібно симулювати одночасно.</p><ul><li>FlightGear це найбільш точний симулятор і в результаті найбільш ресурсомісткий. Він може бути використаний, якщо вам потрібна гарна симуляція, але не надто багато засобів за раз. Також його можна використати, якщо потрібно симулювати різні типи рухомих засобів одночасно.</li><li><a href="./../sim_gazebo_gz/">Gazebo</a> is less accurate and less heavy-weight and supports many features that aren&#39;t available for FlightGear. Він може симулювати набагато більше засобів за раз, ніж FlightGear, та дозволяє симулювати різні їх типи водночас. Він може використовуватись тільки на Ubuntu 20.04 і новіше. Note, this is the successor of <a href="./../sim_gazebo_classic/">Gazebo Classic</a> (below).</li><li><a href="./../sim_gazebo_classic/">Gazebo Classic</a> is less accurate and less heavy-weight and supports many features and vehicles that aren&#39;t available for FlightGear. Він може симулювати набагато більше засобів за раз, ніж FlightGear, та дозволяє симулювати різні їх типи водночас.</li><li>JMAVSim - це дуже легкий симулятор, який підтримує лише квадрокоптери. Рекомендується у випадку, якщо вам необхідно підтримувати багато квадрокоптерів та симуляція може бути приблизна.</li></ul>',5)]))}const f=a(s,[["render",h]]);export{_ as __pageData,f as default};
